import React from "react";
import { Card, Col } from "antd";

const { Meta } = Card;

const TrainImage = () => {
  return (
    <>
      <Col xs={24} md={8}>
        <Card
          hoverable
          cover={
            <img
              alt="teach-images"
              src="images/teach-images.png"
              width="100%"
            />
          }
        >
          <Meta
            title="Image Project"
            description="Teach based on images, from files or your webcam"
          />
        </Card>
      </Col>
    </>
  );
};

export default TrainImage;
